import Myapp from './info';


import {BrowserRouter as Router, Switch, Route,Link} from 'react-router-dom'
import Root from './root';
class App extends Component {
    render() {
        if(localStorage.length!=0){
            <Route exact path="/home" component={Root}></Route>
        }
        return (
            <Router>
                <Switch>
                    <Route exact path='/' component={Myapp}></Route>
                    <Route exact path="/home" component={Root}></Route>
                    {/* <Route exact path='/' render={props=> <Myapp {...props} />}></Route>
                    <Route exact path="/home" component={()=> <Root />}></Route> */}
                    {/* <Route exact path="/home" render={props=> <Root {...props} />}></Route> */}
                </Switch>
            </Router>
        );
    }
}

export default App ;
